var sign=!1;function submitTryit(){sign=!1;for(var a=document.getElementById("TestCode").value.split("\n"),c=a.length,d=[],b=0;b<a.length;b++)if(0!=a[b].length){for(var f=a[b].split(" "),e=0;e<f.length;e++)f[e]=parseInt(f[e]);d[b]=f}else c--;for(b=0;b<c-1;b++)if(!swapLine(d,b,b+1))for(a=b+1;a<c;a++)calLine(a,b,d);a=d[0][0];sign&&(a=-a);for(b=1;b<c;b++)a*=d[b][b];document.getElementById("value").innerHTML=Math.round(a)}
function calLine(a,c,d){for(var b=d[c][c],f=d[a][c],e=c;e<d.length;e++)d[a][e]=d[c][e]*-f/b+d[a][e]}function swapLine(a,c,d){if(0==a[c][c]){sign=!sign;var b=a[c];a[c]=a[d];a[d]=b;d++;return d==a.length&&0==a[c][c]?!0:swapLine(a,c,d)}return!1};
